import "./About.css"

export default function About(){
    return (
        <section id="about">
            <div id="about-page" className="about-page">
                <h1 classname="text"> ElatedLion787</h1>
                <p> Software Engineer, Web Designer and Deep Learning Enthusiast</p>
                <p> This is a collection of my portfolio works over time</p>
            </div>

        </section>
    )
}
